import React from 'react';

const About: React.FC = () => {
    return (
        <div className="about">
            <h1>About Our Church</h1>
            <p>Welcome to our Vietnamese Church! We are a community dedicated to faith, fellowship, and service. Our mission is to spread the love of Christ and support one another in our spiritual journeys.</p>
            <p>Join us for our services, events, and activities as we grow together in faith and community.</p>
        </div>
    );
};

export default About;
